let LimeEmojiss={repoApiUrl:"https://api.github.com/repos/LimeWebb/emojis/contents/",getEmojiSet:async function(e="lime1111"){try{var i=await(await fetch(""+LimeEmojiss.repoApiUrl+e)).json().filter(e=>"file"===e.type);return i?Array.isArray(i)?i.map(e=>({name:e.name.replace(/(\.png)$/,""),url:e.download_url??null})):[]:[]}catch(e){return console.error(e),[]}},getEmojiByName:async function(e="lime1111_dizzy"){const i=e.split("_");e=i[0];return(await LimeEmojiss.getEmojiSet(e)).find(e=>e.name==i[1])?.url??""}};